import './App.css';
import Checkbox from './Checkbox';
import { useState } from 'react';

function App() {
  const [checkbox1, setCheckbox1] = useState(false);
  const [checkbox2, setCheckbox2] = useState(false);
  const [checkbox3, setCheckbox3] = useState(true);
  const [checkbox4, setCheckbox4] = useState(true);

  const handleChange1 = () => setCheckbox1(!checkbox1); 
  const handleChange2 = () => setCheckbox2(!checkbox2); 
  const handleChange3 = () => setCheckbox3(!checkbox3); 
  const handleChange4 = () => setCheckbox4(!checkbox4); 

  console.log('checkbox1 = ',checkbox1);
  console.log('checkbox2 = ',checkbox2);
  console.log('checkbox3 = ',checkbox3);
  console.log('checkbox4 = ',checkbox4);

  return (
    <>
      <Checkbox handler={handleChange1} text='I read the term of the app'/>
      <Checkbox handler={handleChange2} text='I accept the term of the app'/>
      <Checkbox handler={handleChange3} text='I want to get the weekly news letter'/>
      <Checkbox handler={handleChange4} text='I want to get sales and offers'/>
    </>
  );
}

export default App;
